@Triệu Tử phá vòng Đương Dương
- Thông Chí: Triệu Vân tự Tử Long người đất Thường Sơn đời Thục Hán là một dũng tướng theo giúp Lưu Bị lo việc trung hưng nhà Hán. Lưu Bị khi ở Tân Dã bị Tào Tháo đánh bại bỏ chạy, quân Tào đuổi theo đến Đương Dương (Nay thuộc Hồ Bắc). thì Lưu Bị phải bỏ cả vợ con mà chạy về phía nam. Tướng tá lạc nhau, Triệu Vân một mình bảo vệ vợ con Lưu Bị đánh phá vòng vây trùng điệp của quân Tào, vượt cầu Trường Bản tìm gặp Lưu Bị, bảo toàn được A Đẩu. Triệu Vân giúp Lưu Bị lấy thành đô, bình định ích Châu, giữ chức Chinh Đông tướng quân, thường đánh nhau với Tào Tháo nhiều lần, bị quân Tào vây, Triệu Vân đều dùng kế phá được quân Tào. (Tam Quốc chí, Thục Liệt truyện)

